// src/pages/PlanChoice.js
import React from 'react';
import { useNavigate } from 'react-router-dom';
import './PlanChoice.css';

function PlanChoice() {
  const navigate = useNavigate();

  return (
    <div className="plan-choice-container">
      <h1>What would you like to do?</h1>
      <div className="plan-choice-buttons">
        <button onClick={() => navigate('/plans')} className="secondary-btn">
          View Existing Plans
        </button>
        <button onClick={() => navigate('/create')} className="primary-btn">
          Start a New Plan
        </button>
      </div>
    </div>
  );
}

export default PlanChoice;
